import React, { Component, useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col } from 'reactstrap';

import BootstrapTable from "react-bootstrap-table-next";
import paginationFactory from "react-bootstrap-table2-paginator";
import * as ReactBootStrap from "react-bootstrap";

import { List1 } from '../styles'

const Lista = props => (
  <tr>
    <td>{props.lista.state}</td>
    <td>{props.lista.cidade}</td>
    <td>{props.lista.data}</td>
    <td>{props.lista.casos}</td>
    <td>{props.lista.mortes}</td>
  </tr>
  
)

export default class FeedbackList extends Component {
  constructor(props) {
    super(props);

    this.state = {getListaData: []};
   
   
  }

  componentDidMount() {
    const [listas, setListas] = useState([]);
    const [loading, setLoading] = useState(false);
    const getListaData = async () => {
    try {
      const data = await axios.get('http://localhost:5000/lista_diaria/');
      console.log(data);
    } catch (e){
      console.log(e);
    }
    }


    // axios.get('http://localhost:5000/lista_diaria/')
    //   .then(response => {
    //     this.setState({ listas: response.data })
    //   })
    //   .catch((error) => {
    //     console.log(error);
    //   })
  }
  
 
  
  listaCovid() {
    return this.state.listas.map(currentmapalistdiario => {
      return <Lista lista={currentmapalistdiario} key={currentmapalistdiario._id}/>;
    })
    
  }

  

  render() {
    return (
      <div>
        <List1>
        <h3>Lista De Casos Diarios</h3>
          </List1>
      <Container className="themed-container" fluid={true}>
        <Row>
        <Col>
        <table className="table">
          <thead className="thead-light">
            <tr>
              <th>Estado</th>
              <th>Cidade</th>
              <th>Data</th>
              <th>Casos Confirmados</th>
              <th>Mortes</th>
            </tr>
          </thead>
          <tbody>
            { this.listaCovid() }
          </tbody>
        </table>
        </Col>
        </Row>
      </Container>
      </div>
    )
  }
}
